import React from "react";
import "./css/ServiceBanner.css";
import backgroundVideo from "../Images/service_banner_bcg.mp4";
import backgroundBcg from "../Images/service_bcg_banner.mp4";
import { RiPauseCircleLine } from "react-icons/ri";
import { RiPlayCircleLine } from "react-icons/ri";

const ServiceBanner = () => {
  return (
    <div className="serviceBanner">
      <video autoPlay loop muted className="serviceBannerMp4">
        <source src={backgroundVideo} type="video/mp4" />
      </video>
      <div className="video__control__container">
        {/* <RiPlayCircleLine className="video__controls" /> */}
        <RiPauseCircleLine className="video__controls" />
      </div>
      <div className="info__container">
        <span className="info__header">EXPLORE SERVICES</span>
      </div>
    </div>
  );
};

export default ServiceBanner;
